<!doctype html>
<html lang="ar" dir="rtl">
<head>
<meta charset="utf-8" />
<meta name="viewport" content="width=device-width,initial-scale=1" />
<title>0rucoin Firebase — النسخة النهائية</title>
<link href="https://fonts.googleapis.com/css2?family=Cairo:wght@300;400;600;700&display=swap" rel="stylesheet">
<style>
:root{--bg:#07101a;--card:#0f1724;--accent:#06b6d4;--muted:#99b4c7;--glass:rgba(255,255,255,0.03);--radius:12px;}
*{box-sizing:border-box}
html,body{height:100%}
body{margin:0;font-family:'Cairo', system-ui, Roboto, 'Noto Kufi Arabic',sans-serif;background:linear-gradient(180deg,#051018,var(--bg));color:#e6eef8;padding:18px;direction:rtl;}
.card{background:linear-gradient(180deg,var(--card),#07101a);padding:14px;border-radius:12px;margin-top:12px}
.avatar{width:56px;height:56px;border-radius:50%;object-fit:cover;border:2px solid rgba(255,255,255,0.04)}
.small{font-size:13px;color:var(--muted)}
input,button{padding:6px 10px;margin-top:6px;border-radius:6px;border:none}
button{background:var(--accent);color:#fff;cursor:pointer}
</style>
</head>
<body>
<h1>0rucoin — النسخة النهائية Firebase</h1>
<p class="small">يدعم البريد، رفع الصور، إرسال واستلام العملات، هدية يومية، والبيانات مشتركة عبر Firebase.</p>

<!-- Firebase SDKs -->
<script type="module">
// Firebase placeholders — ضع قيمك هنا
import { initializeApp } from "https://www.gstatic.com/firebasejs/10.5.0/firebase-app.js";
import { getAnalytics } from "https://www.gstatic.com/firebasejs/10.5.0/firebase-analytics.js";
import { getFirestore, collection, doc, setDoc, getDoc, getDocs, updateDoc, query, where } from "https://www.gstatic.com/firebasejs/10.5.0/firebase-firestore.js";
import { getStorage, ref, uploadBytes, getDownloadURL } from "https://www.gstatic.com/firebasejs/10.5.0/firebase-storage.js";
import { getAuth, createUserWithEmailAndPassword, signInWithEmailAndPassword } from "https://www.gstatic.com/firebasejs/10.5.0/firebase-auth.js";

// ضع هنا config Firebase
const firebaseConfig = {
  apiKey: "ضع_المفتاح_هنا",
  authDomain: "ضع_الـauthDomain",
  projectId: "ضع_projectId",
  storageBucket: "ضع_storageBucket",
  messagingSenderId: "ضع_messagingSenderId",
  appId: "ضع_appId",
  measurementId: "ضع_measurementId"
};

const app = initializeApp(firebaseConfig);
const analytics = getAnalytics(app);
const db = getFirestore(app);
const storage = getStorage(app);
const auth = getAuth(app);
</script>

<div id="app">
